import { useState, useEffect } from "react";
import CompanyModal from "../../Common/CompanyModal";
import LoanIconButton from "../../../Common/LoanIconButton";
import { BsPlus } from "react-icons/bs";
import { IconButton } from "@material-tailwind/react";
import {
  InputLabel,
  TextField,
  MenuItem,
  FormControl,
  Select,
} from "@mui/material";
import CommonServices from "../Common/CommonServices";
const AddMaritalStatus = () => {
    const [submitted, setSubmitted] = useState(false);  
  const [isCompanyMaritalStatusModalOpen, setIsCompanyMaritalStatusModalOpen] =
    useState(false);
  function handleGeneralCloseModal() {
    isCompanyMaritalStatusModalOpen(false);
  }
  function handleCompanyMaritalStatusCloseModal() {
    setIsCompanyMaritalStatusModalOpen(false);
  }
  
  const [maritalStatusIdInformationId, setMaritalStatusIdInformationId] =
    useState(null);
    const [country, setContry] = useState([]);
    const [proofOfIdentityType, setProofOfIdentityType] = useState([]);
  const initialMaritalStatusMarriedState = {
    Id: null,
    SoleAndPartnerShipID: maritalStatusIdInformationId,
    FirstName: "",
    MiddleName: "",
    LastName: "",
    NationalityID: "",
    CountryOfOriginID: "",
    CountryOfResidenceID: "",
    ProofOfIdentityTypeID: "",
    ProofOfIdentity: "",
    MarriageDate: "",
    MarriageCertificate: "",
    MarriageCertificateIssuer: "",
    ProofOfIdentityIssueDate: "",
    ProofOfIdentityExpirDate: "",
  };
  const [maritalStatusMarried, setMaritalStatusMarried] = useState(
    initialMaritalStatusMarriedState
  );
  const newMaritalStatusMarried = () => {
    setMaritalStatusMarried(initialMaritalStatusMarriedState);
    setSubmitted(false);
  };
  const handleInputChangeMartailStatusMarried = (event) => {
    const { name, value } = event.target;
    setMartailStatusMarried({ ...martailStatusMarried, [name]: value });
  };
  const saveMarried = () => {
    var data = {
      SoleAndPartnerShipID: martailStatusMarried.SoleAndPartnerShipID,
      FirstName: martailStatusMarried.FirstName,
      MiddleName: martailStatusMarried.MiddleName,
      LastName: martailStatusMarried.LastName,
      NationalityID: martailStatusMarried.NationalityID,
      CountryOfOriginID: martailStatusMarried.CountryOfOriginID,
      CountryOfResidenceID: martailStatusMarried.CountryOfResidenceID,
      ProofOfIdentityTypeID: martailStatusMarried.ProofOfIdentityTypeID,
      ProofOfIdentity: martailStatusMarried.ProofOfIdentity,
      MarriageDate: martailStatusMarried.MarriageDate,
      MarriageCertificate: martailStatusMarried.MarriageCertificate,
      MarriageCertificateIssuer: martailStatusMarried.MarriageCertificateIssuer,
      ProofOfIdentityIssueDate: martailStatusMarried.ProofOfIdentityIssueDate,
      ProofOfIdentityExpirDate: martailStatusMarried.ProofOfIdentityExpirDate,
    };
    CommonServices
      .marriedSole(data, martialStatusIdInformationId)
      .then((response) => {
        setMartailStatusMarried({
          Id: response.data.Id,
          SoleAndPartnerShipID: response.data.SolleAndPartnerShipID,
          FirstName: response.data.FirstName,
          MiddleName: response.data.MiddleName,
          LastName: response.data.LastName,
          NationalityID: response.data.NationalityID,
          CountryOfOriginID: response.data.CountryOfOriginID,
          CountryOfResidenceID: response.data.CountryOfResidenceID,
          ProofOfIdentityTypeID: response.data.ProofOfIdentityTypeID,
          ProofOfIdentity: response.data.ProofOfIdentity,
          MarriageDate: response.data.MarriageDate,
          MarriageCertificate: response.data.MarriageCertificate,
          MarriageCertificateIssuer: response.data.MarriageCertificateIssuer,
          ProofOfIdentityIssueDate: response.data.ProofOfIdentityIssueDate,
          ProofOfIdentityExpirDate: response.data.ProofOfIdentityExpirDate,
        });
        // console.log(response.data);
        // setHoldId(response.data.Result.Id);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  const fetchContry = () => {
    CommonServices
      .getCountry()
      .then((response) => {
        // console.log(response.data.Result);
        setContry(response.data.Result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    fetchContry();
  }, []);
  
  const fetchProofOfIdentityType = () => {
    CommonServices
      .getProofOfIdentityTypes()
      .then((response) => {
        // console.log(response.data.Result);
        setProofOfIdentityType(response.data.Result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    fetchProofOfIdentityType();
  }, []);
  return (
    <div>
      <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
        <TextField
          id="FirstName"
          label="FirstName"
          variant="standard"
          color="secondary"
          size=""
          required
          value={martailStatusMarried.FirstName}
          onChange={handleInputChangeMartailStatusMarried}
          name="FirstName"
        />
        <TextField
          id="MiddleName"
          label="MiddleName"
          variant="standard"
          color="secondary"
          size=""
          required
          value={martailStatusMarried.MiddleName}
          onChange={handleInputChangeMartailStatusMarried}
          name="MiddleName"
        />
        <TextField
          id="LastName"
          label="LastName"
          variant="standard"
          color="secondary"
          size=""
          required
          value={martailStatusMarried.LastName}
          onChange={handleInputChangeMartailStatusMarried}
          name="LastName"
        />
        <FormControl variant="standard" sx={{ minWidth: 120 }}>
          <InputLabel id="countrylbl" color="secondary">
            {" "}
            Nationality{" "}
          </InputLabel>
          <Select
            color="secondary"
            onChange={(event) =>
              (martailStatusMarried.NationalityID = event.target.value)
            }
            labelId="countrylbl"
            id="countrySelect"
            label="Country"
          >
            <MenuItem value="">
              <em>None</em>
            </MenuItem>
            {country.map((yourCounty) => (
              <MenuItem
                key={yourCounty.Id}
                NationalityID={yourCounty.Id}
                value={yourCounty.Id}
              >
                {yourCounty.Name}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
        <FormControl variant="standard" sx={{ minWidth: 120 }}>
          <InputLabel id="countrylbl" color="secondary">
            {" "}
            Country Of Origin{" "}
          </InputLabel>
          <Select
            color="secondary"
            onChange={(event) =>
              (martailStatusMarried.CountryOfOriginID = event.target.value)
            }
            labelId="countrylbl"
            id="countrySelect"
            label="Country"
          >
            <MenuItem value="">
              <em>None</em>
            </MenuItem>
            {country.map((yourCounty) => (
              <MenuItem
                key={yourCounty.Id}
                NationalityID={yourCounty.Id}
                value={yourCounty.Id}
              >
                {yourCounty.Name}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
        <FormControl variant="standard" sx={{ minWidth: 120 }}>
          <InputLabel id="countrylbl" color="secondary">
            {" "}
            Country Of Residence{" "}
          </InputLabel>
          <Select
            color="secondary"
            onChange={(event) =>
              (martailStatusMarried.CountryOfResidenceID = event.target.value)
            }
            labelId="countrylbl"
            id="countrySelect"
            label="Country"
          >
            <MenuItem value="">
              <em>None</em>
            </MenuItem>
            {country.map((yourCounty) => (
              <MenuItem
                key={yourCounty.Id}
                NationalityID={yourCounty.Id}
                value={yourCounty.Id}
              >
                {yourCounty.Name}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
        <FormControl variant="standard" sx={{ minWidth: 120 }}>
          <InputLabel id="countrylbl" color="secondary">
            {" "}
            Proof Of Identity Type{" "}
          </InputLabel>
          <Select
            color="secondary"
            onChange={(event) =>
              (martailStatusMarried.ProofOfIdentityTypeID = event.target.value)
            }
            labelId="countrylbl"
            id="countrySelect"
            label="Country"
          >
            <MenuItem value="">
              <em>None</em>
            </MenuItem>
            {proofOfIdentityType.map((yourProofOfIdentityType) => (
              <MenuItem
                key={yourProofOfIdentityType.Id}
                ProofOfIdentityTypeID={yourProofOfIdentityType.Id}
                value={yourProofOfIdentityType.Id}
              >
                {yourProofOfIdentityType.Name}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
        <TextField
          id="ProofOfIdentity"
          label="ProofOfIdentity"
          variant="standard"
          color="secondary"
          size=""
          required
          value={martailStatusMarried.ProofOfIdentity}
          onChange={handleInputChangeMartailStatusMarried}
          name="ProofOfIdentity"
        />
        <TextField
          id="MarriageDate"
          label="MarriageDate"
          variant="standard"
          color="secondary"
          size=""
          required
          value={martailStatusMarried.MarriageDate}
          onChange={handleInputChangeMartailStatusMarried}
          name="MarriageDate"
        />
        <TextField
          id="MarriageCertificate"
          label="MarriageCertificate"
          variant="standard"
          color="secondary"
          size=""
          required
          value={martailStatusMarried.MarriageCertificate}
          onChange={handleInputChangeMartailStatusMarried}
          name="MarriageCertificate"
        />
        <TextField
          id="MarriageCertificateIssuer"
          label="MarriageCertificateIssuer"
          variant="standard"
          color="secondary"
          size=""
          required
          value={martailStatusMarried.MarriageCertificateIssuer}
          onChange={handleInputChangeMartailStatusMarried}
          name="MarriageCertificateIssuer"
        />
        <TextField
          id="ProofOfIdentityIssueDate"
          label="ProofOfIdentityIssueDate"
          variant="standard"
          color="secondary"
          size=""
          required
          value={martailStatusMarried.ProofOfIdentityIssueDate}
          onChange={handleInputChangeMartailStatusMarried}
          name="ProofOfIdentityIssueDate"
        />
        <TextField
          id="ProofOfIdentityExpirDate"
          label="ProofOfIdentityExpirDate"
          variant="standard"
          color="secondary"
          size=""
          required
          value={martailStatusMarried.ProofOfIdentityExpirDate}
          onChange={handleInputChangeMartailStatusMarried}
          name="ProofOfIdentityExpirDate"
        />
      </div>
      <div>
        <button
          className="bg-[purple] hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
          onClick={() => {
            saveMarried();
            // setToggleMarriedInfo(!toggleMarriedInfo);
          }}
        >
          save
        </button>
      </div>
    </div>
  );
};

export default AddMaritalStatus;
